import React  from 'react';
import { Route, withRouter, Redirect } from 'react-dom'
import './index.sass'

// COMPONENTS
import Landing from '../Landing'
import Login from '../Login'
import Register from '../Register'

export default withRouter(function ({ history }) { 


// LANDING

function handleGoToLogin() { history.push('/login') } 
function handleGoToRegister() { history.push('/register') }


return (
        <>
            <Route exact path="/" render={() => <Redirect to="/landing" /> }/>
            <Route path="/landing" render={() => <Landing onLogin={handleGoToLogin} onRegister={handleGoToRegister} /> }/> 
            <Route exact path="/login" render={() => <Login to="/login" /> }/>
            <Route exact path="/register" render={() => <Register to="/register" /> }/>
        </>
    )

})
